import React, {Component} from 'react';

class Login extends Component{
  render(){
    return (
      <div className="imgcontainer">
        <img src={require("/pics/payjunction-ecommerce.png" )} className="logo" style="width:230.7px; height: 155.3px;"/>
        <button id="elgoog" className="btn btn-info" >Sign In with Google</button>
        <button id="elgoog" className="btn btn-light" >Sign Up with Google</button>
      </div>
    );
  }
}

export default Login;
